import httpClient from "../http-common1";

const create = (data) => {
    return httpClient.post("/security/createUser", data);
  };

  const getAll = () => {
    return httpClient.get("/security/user/g");
  };

  const createTrain = (data) => {
    return httpClient.post("/security/admin/p/t", data);
  };
  const createTicket = (data) => {
    return httpClient.post("security/user/p/ticket", data);
  };
  const fullticket=(emailId)=>{
    return httpClient.get(`security/user/ga/viewticket/${emailId}`);
  }

  export default {create,getAll,createTrain,createTicket,fullticket};
